import React from 'react';
import './CreditInfoSection.css';
import pic3 from './pic3.jpeg'; // Path to your left image
import pic4 from './pic4.jpeg'; // Path to your right image

const CreditInfoSection = () => {
  return (
    <div className="credit-info-section">
      <div className="credit-info-block">
        <img src={pic3} alt="Credit Trend Illustration" className="credit-info-image left" />
        <div className="credit-info-content">
          <h3>To track your credit score, EMI payment trends and much more</h3>
          <p>We will update you with monthly credit reports for 12 months.</p>
          <p>Helps in tracking your credit score trend, account mix and history of EMI payments.</p>
        </div>
        <img src={pic4} alt="Prevent Credit Score Fall Illustration" className="credit-info-image right" />
      </div>
      <div className="credit-info-block">
        <div className="credit-info-content">
          <h3>To stop your credit score from falling!</h3>
          <p>Helps in identifying accounts affecting your credit score.</p>
          <p>Get step by step guidance to resolve it.</p>
          <p>Get it corrected with the Credit Bureau.</p>
        </div>
      </div>
    </div>
  );
};

export default CreditInfoSection;
